import React from 'react'
import '../Myskills/myskills.css';
import useStyles from "./styles";
import { FaReact, FaCss3Alt , FaHtml5, FaJava, FaNodeJs} from 'react-icons/fa'
import { IoLogoJavascript} from 'react-icons/io'
import { SiAdobexd , SiAdobephotoshop, SiAdobeillustrator } from 'react-icons/si'


function Myskills(props) {

    const classes = useStyles();

    return (
        <>
            <div className="my_card">
                <p className={classes.font}>skills</p>
                <FaReact size="3em"></FaReact>
                <FaHtml5 size="3em"></FaHtml5>
                <FaCss3Alt size="3em"></FaCss3Alt>
                <FaJava size="3em"></FaJava>
                <IoLogoJavascript size="3em"></IoLogoJavascript>
                <FaNodeJs size="3em"></FaNodeJs>
                <SiAdobexd></SiAdobexd>
                <SiAdobephotoshop></SiAdobephotoshop>
                <SiAdobeillustrator></SiAdobeillustrator>
            </div>

        </>
    );
}

export default Myskills;
